import React from "react";
import Navbar from "../components/Navbar/Navbar";
import Container from "../maths-wizard/Container/Container";

function MathsWizard() {
  return (
    <div>
      <Navbar logo="MATHS WIZARD" />
      <Container />
    </div>
  );
}

export default MathsWizard;
